        <div>
<Container fluid  className=" black">
<Container className=" text-white black">
    <span>Free shipping, 30-day return or refund guarantee.</span>
<ul className="text-end m-0">
    <li>signin</li>
    <li>FAQs</li>
    <li>USD</li>
</ul>
</Container>
</Container>
        </div>
    );
};

export default Home1;
